package com.fun.voznoad.model;

public class Page1ChildItem {
	public String title;
	public String view;
	public String link;
	
	public Page1ChildItem(String title, String view, String link) {
		super();
		this.title = title;
		this.view = view;
		this.link = link;
	}
	public Page1ChildItem() {
		// TODO Auto-generated constructor stub
	}
	public String getTitle() {
		return title;
	}
	public void setTitle(String title) {
		this.title = title;
	}
	public String getView() {
		return view;
	}
	public void setView(String view) {
		this.view = view;
	}
	public String getLink() {
		return link;
	}
	public void setLink(String link) {
		this.link = link;
	}
	
}
